VALUES
	(1,1,'研究：每天摄入较多咖啡因可能让部分人青光眼风险上升','咖啡','','https://zkres1.myzaker.com/202106/60c5bc438e9f0972024b7c9a_1024.jpg',NULL,'<p>新华社伦敦6月8日电(记者张家伟)英国伦敦大学学院8日公布的一项研究显示，那些具有高眼压遗传倾向的人，如果每天摄入较多咖啡因可能会增加青光眼的患病风险。</p>\r\n<p>　　青光眼和眼压高有密切的关联。美国芒特西奈伊坎医学院、英国伦敦大学学院等机构的学者分析了咖啡因摄入对青光眼以及眼压的影响，研究成果已刊登在最新一期《眼科学》杂志上。</p>\r\n<p>　　研究人员基于英国生物样本库，选取超过12万名年龄在39至73岁之间的研究对象，分析了他们在2006年至2010年间的相关健康记录和脱氧核糖核酸样本。这其中包括他们每天通过饮品和食物摄入咖啡因的量以及青光眼家族病史等情况。</p>\r\n<p>　　结果显示，较高的咖啡因摄入量总体上与高眼压或青光眼患病风险几乎没有关联，但对于有明显高眼压遗传倾向的研究对象，较大量的咖啡因摄入与青光眼疾病风险升高具有关联性。</p>\r\n<p> </p>\r\n<p>　　数据表明，有明显高眼压遗传倾向的人群中，每日咖啡因摄入量高于480毫克的人青光眼患病风险比每日摄入量低于80毫克的人高1.3倍；相比没有高眼压遗传倾向且几乎不摄入咖啡因的人，有明显高眼压遗传倾向的人群中每日咖啡因摄入量高于321毫克的人患青光眼风险高3.9倍。</p>\r\n<p>　　报告作者之一、伦敦大学学院的安东尼·卡瓦贾博士说，从研究结果来看那些在遗传上具有较高青光眼患病风险的人如果能控制咖啡因摄入或许会带来助益。</p>',NULL,1,1623476139,1624069075,NULL),
	(2,1,'痛经都是“宫寒”闹的？没这么简单！',NULL,'','http://cms-bucket.ws.126.net/2021/0617/dae5cb87p00quuns9001ac0009c0070c.png?imageView&thumbnail=140y88&quality=85',NULL,'<p>对于不少女性朋友来说，\" 每个月的那几天 \" 都曾经历过不适。常听人说，这是 \" 宫寒 \" 在作怪。于是，常见女生们捧着姜枣茶、红糖水，以消除被 \" 姨妈疼 \" 支配的恐惧。</p>\r\n<p>痛经真的都是 \" 宫寒 \" 闹的吗？其实也不尽然。\" 宫寒 \" 指女性肾阳不足，子宫寒冷，气血运行不畅。实际上，\" 宫寒 \" 只是痛经最常见的一个原因。要想彻底解决痛经问题，还需要对症下药。</p>\r\n<p>要对付 \" 姨妈疼 \" 先得找到病根儿</p>\r\n<p>中医认为痛经发生的原因主要有两大类：一是实证，即 \" 不通则痛 \"。由于寒、湿、热等内外邪阻碍气血运行而造成瘀滞，其中因寒致瘀的最为普遍。经常或经期、产后贪食生冷、坐卧湿地、冒雨涉水、久处阴冷环境导致 \" 宫寒 \"。这类患者宜驱寒祛瘀止痛。</p>\r\n<p>二是虚证，即 \" 不荣则痛 \"。是由于气血虚弱或肝肾亏损而失于濡养。这类患者平时应注意调补，宜补气养血或补益肝肾。</p>\r\n<p>中医如何治疗痛经？运用中医理论进行辨证，将痛经大致分为四种类型来治疗。</p>\r\n<p>气滞血瘀型 表现为经前或行经期间出现小腹胀痛、乳房胀痛或刺痛、心烦易怒，经色暗或有血块，经量少或行经不畅等。应服具有疏肝理气、化瘀止痛作用的药物。</p>\r\n<p>气血虚弱型 表现为经期小腹绵绵作痛，月经色淡质薄，月经量少，神疲乏力，面色蜡黄，食欲欠佳，大便溏泻等。应服具有益气补血止痛作用的药物。</p>\r\n<p>阳虚内寒型 表现为经期或经后小腹冷痛，经色淡暗或有血块，月经量少，伴有腰酸腿软，手足不温，小便清长等，即平常说的 \" 宫寒 \"。应服有温经散寒，养血止痛作用的药物。比如红糖姜汤，能补气养血，温经活血。其中红糖具有补血、散瘀、暖肝、祛寒等功效，生姜有补中散寒、缓解痛经的功效。</p>\r\n<p>肝肾虚损型 表现为月经干净后 1 至 2 日出现腰酸腿软，小腹隐痛不适，或有潮热、头晕耳鸣等。应服具有益肾养肝止痛作用的药物。</p>\r\n<p>市面上针对痛经有常见的中成药如艾附暖宫丸、月月舒痛经宝颗粒、乌鸡白凤丸、桂枝茯苓胶囊、益母草冲剂、散结镇痛胶囊、广西花红片等，需在中医师指导下辨证选用。</p>\r\n<p>这三种痛经或暗藏疾病危险</p>\r\n<p>痛经分为原发性痛经和继发性痛经两类。原发性痛经又称为功能性痛经，青春期多见，常在初潮后 1 至 2 年内发病。大多与激素波动密切相关，精神、心理因素也可以导致，可通过改变生活方式来调节。但若痛经的时间长达 3 天以则应采取止痛措施对症治疗。</p>\r\n<p>继发性痛经的症状常常是进行性加重，由盆腔器质性疾病引起。妇科盆腔检查、影像学检查等辅助检查可提供诊断依据，要针对病因治疗。以下几种痛经可能提示女性朋友患有某些疾病，当引起重视：</p>\r\n<p>1. 月经量增多，痛经越来越厉害，持续时间越来越长，有可能是患上子宫内膜异位症；</p>\r\n<p>2. 经期发烧、下腹坠痛严重，可能是患了盆腔炎；</p>\r\n<p>3. 经血颜色为淡茶褐色，或气味发生变化，同时体温升高和下腹痛，则有可能患上了子宫内膜炎。</p>\r\n<p>痛经因病因不同、分型不同，一旦有了痛经情况，需到医院面医就诊，分析明确后选择合适的治疗、调理方案，才能取得较好的效果，并避免贻误病情。如出现月经期腹部剧烈疼痛，伴有面色发白、出冷汗或月经期突然晕倒等严重情况，应及时就诊，刻不容缓。</p>\r\n<p>\" 姨妈疼 \" 再偷袭 试试这 8 招儿</p>\r\n<p>针对痛经有哪些缓解的简便方法？造成痛经的原因有很多，可根据痛经的类型选择其中 1 至 2 种即可。</p>\r\n<p>1. 姜糖水。取红糖 20 克，红枣 5 枚，生姜片 6 克。加水适量煎汤饮。月经前两天开始服，每天 1 剂，连服 3 至 5 天。本方适用于寒邪凝滞型痛经。 ( 有糖尿病者不适合 )</p>\r\n<p>2. 玫瑰花茶。取玫瑰花 3 至 5 枚泡水代茶饮。各型均宜。</p>\r\n<p>3. 黄芪 20 克，当归 10 克，大枣 10 克，红花 6 克。将上述药物用水煎煮后去渣取汁，每日服 1 剂，分 3 次服完。在每次月经来潮前 3 天开始服用，连服 5 天。此方具有补益气血、行气止痛功效，适用于虚损型痛经。</p>\r\n<p>4. 按压穴位。手上的合谷穴、下腹部的关元穴和气海穴、小腿部的三阴交是缓解痛经的有效穴位。注意体质差者合谷穴刺激不宜太强。</p>\r\n<p>5. 穴位压豆。简单方便快捷，可自己操作。常用穴位：内分泌、子宫、神门。</p>\r\n<p>6. 敷脐疗法。将生姜片或大盐炒热用纱布包后敷在肚脐眼上，也能起到不错的止痛作用。中医认为生姜性温、具有驱寒暖身的作用，切成片后能使生姜中的辛温成分更好地散发出来，促进体内寒气的排出。</p>\r\n<p>7. 灸法。主要是借助火的热力和药物的作用，对神阙、关元、命门、肾俞进行灸疗。具有温肾散寒暖宫、消瘀散结止痛的作用。</p>\r\n<p>8. 中药泡足。取中药当归 20 克，红花 20 克，苏木 15 克，寒明显的可加生姜 20 克，用水 3 升，煎煮 20 分钟，不用去渣，冷却至适合的温度（视各人对温度耐受度调整），泡脚每次 20-30 分钟，每天可以泡 2 次。（有足疗禁忌症者不适合此法）</p>\r\n<p>文 / 谢燕芳（北京友谊医院）</p>',NULL,1,1624021462,1624022902,NULL),
	(3,1,'不洗脸皮肤会变好？关于“面子”问题，你想问不敢问的答案都在这了',NULL,'',NULL,NULL,'<div id=\"article\" class=\"article_content\" style=\"box-sizing: border-box; margin-right: 0px; font-size: 18px; color: #3b3b3b; line-height: 32px; font-family: PingFangSC-regular, \'Microsoft YaHei\';\">\r\n<div id=\"content\" style=\"box-sizing: border-box;\">\r\n<p>最近这段时间每天也不出门，脸都懒得洗，是不是真的皮肤会变好 ?</p>\r\n<p>不洗脸或许会让你短时间内觉得皮肤好像变好了，但其实这些都是假象，过度分泌的油脂会堵塞毛孔，加上不规律的饮食和作息，痘痘就等着爆发呢。</p>\r\n<p>宅在家里该怎么洗脸 ?</p>\r\n<p>首先要搞清楚自己的肤质，如果你是油皮，每天晚上睡前 还是要认认真真用洗面奶进行面部清洁，早上起来如果觉 得皮肤不是很油就用清水洗一下就好。</p>\r\n<p>中性或者干性肌肤是不是可以不用洗两遍脸 ?</p>\r\n<p>虽然没有出门，但空气中还是会有灰尘和微生物。在家你会接触你的宠物，或者做饭的油烟，这些停留在脸上都是会给肌肤造成隐患的，所以不管你是什么肤质，正常的清洁步骤是不能减少的。</p>\r\n<p>不想过度清洁，有没有什么好的方法 ?</p>\r\n<p>可以选择相对温和的洁面产品，或者直接用温水沾湿棉巾进行擦拭，减少对角质层的伤害。也可以用成分简单的爽肤水或者纯露进行擦拭清洁。</p>\r\n<p>每个男人都要剃须，有人偏爱电动，有人则钟爱手动。有人把剃须当作每天充满仪式感的一项工作去完成， 也有人拿着酒店一次性的剃须刀就着洗面奶顺手把胡子给刮了。到底我该怎么对待剃须这件事 ? 有哪些需要注意的 ?</p>\r\n<p>最近下巴附近长痘了，该怎么剃须才不会伤害到皮肤呢 ?</p>\r\n<p>尽量避开长痘的地方，不要把痘痘弄破。因为在剃须时弄破痘痘很容易感染，造成其他的 问题。当然还是比较建议长痘的时候用电动剃须刀，相对手动安全性会更高不会有弄破皮 肤的危险。</p>\r\n<p>一定要配合剃须泡吗 ? 是不是也需要按照肤质选择剃须泡 ?</p>\r\n<p>如果你用手动剃须刀，还是建议要使用剃须泡的，当然也要看你胡子的状态，如果很稀疏 且不是很硬也是可以用洗面奶作为介质的，只是起到一个润滑的作用。但如果你的胡子比较浓密且硬，那还是要用剃须泡的，一方面是可以起到软化胡须的作用，另一方面也是可以保护肌肤不被刀片伤害，如果你是敏感肌，还能避免剃须后肌肤泛红。</p>\r\n<p>多刀头的剃须刀真的有用吗 ?</p>\r\n<p>首先肯定会加快你的剃须效率，让剃须工作变得简单。其次，多刀头多角度可以更好地贴 合面部轮廓，剃得也会更干净，尤其是针对下颌处的胡子。</p>\r\n<p>剃须的最佳时间是早上还是晚上 ?</p>\r\n<p>很多人早上想多睡一会儿，就把剃须工作放到晚上，但一般一觉醒来都会发现刚剃好的胡子又有往外冒的势头反而显得不那么清爽了。其实是因为，晨间是激素最活跃的时候，当然也是胡子长得最快的时候。所以，如果你想剃得干净清爽，就要把剃须安排在早上来进行。</p>\r\n<p>&nbsp;</p>\r\n<p style=\"margin: 28px 0px !important; padding: 0px;\">&nbsp;</p>\r\n<div id=\"recommend_bottom\" style=\"box-sizing: border-box;\"></div>\r\n<div id=\"article_bottom\" style=\"box-sizing: border-box;\"></div>\r\n</div>\r\n</div>',NULL,1,1624021499,1624021499,NULL),
	(4,1,'水喝不对会中毒还致癌？科学喝水这样做',NULL,'','http://cms-bucket.ws.126.net/2021/0616/19a8dd03p00qusvc50013c0009c0070c.png?imageView&thumbnail=140y88&quality=85',NULL,'<p>水是生命之源，每天我们都要摄入大量的水，可你真的知道该怎么喝水吗？如今，网上有很多关于饮水的说法，如喝隔夜水致癌、每天喝 4 升水会中毒、喝水垢较多的水容易患结石……这都是真的吗？</p>\r\n<p>喝隔夜水和千滚水致癌？</p>\r\n<p>真相：其中所含亚硝酸盐未超标准值</p>\r\n<p>\" 喝隔夜水、千滚水致癌 \" 这个说法在微信朋友圈已横行多年，不少长辈对此深信不疑，该传闻称隔夜白开水和煮开过多次的水（俗称千滚水）中，均含有亚硝酸盐，此物为致癌物。事实真是如此吗？</p>\r\n<p>中国农业大学食品科学与营养工程学院副教授范志红表示，人们担心的致癌物质——亚硝酸盐须在含有硝酸盐的物质中才会产生，而普通的饮用水中，要么只含有矿物质和微量元素，要么什么都没有，这种情况下致癌物质不会凭空出现。只要保证水的来源符合标准，理论上水再怎么烧也不会产生致癌物质。</p>\r\n<p>\" 大家完全不用担心隔夜水、千滚水中含有过量的亚硝酸盐。\" 科信食品与营养信息交流中心科学技术部主任阮光锋在科技日报记者采访时表示，隔夜水和千滚水常被扣上 \" 亚硝酸盐超标 \" 的帽子，进而和 \" 致癌 \" 扯上关系。真相是，即使反复烧开 20 次的水，亚硝酸盐的含量都到不了国家饮用水标准要求上限数值的 3%。实验同样证明，隔夜（甚至隔好几夜）的水，其亚硝酸盐含量距离超标值还差得很远。</p>\r\n<p>另外，阮光锋特别提示，虽然隔夜的白开水对人体无碍，但是喝隔夜的茶水对健康确实不利。\" 这主要是因为茶叶浸泡后的水会产生氨基酸等物质，时间一长易滋生微生物。\" 他说。</p>\r\n<p>每天喝 4 升水会中毒？</p>\r\n<p>真相：只要不是短时内猛喝无需担心</p>\r\n<p>感冒？多喝水！头痛？多喝水！心情不好？多喝水……在很多人眼中，多喝水似乎已成为解决一切问题的 \" 完美方案 \"。</p>\r\n<p>不过网上有传言称，世界卫生组织专家布鲁斯 · 戈登表示，每天饮水量超 4 升，就可能中毒，甚至导致大脑功能受损，严重时还可能危及生命。虽然世界卫生组织称该观点系误读，并及时做出了辟谣，但不少人仍会隐隐担心，多喝水会对健康造成影响吗？</p>\r\n<p>正常成年人的体液量约占体重的 60%，人获取水分主要有两个途径：其一是从食物中摄取，大约每日 700 毫升至 2000 毫升，它们主要由胃肠道吸收；其二是每日人体在代谢过程中会产生约 300 毫升水。这些水大部分会形成尿液经人体泌尿系统排出，也有少量以水蒸气或汗液的形式经肺部或皮肤排出。</p>\r\n<p>相关专家表示，医学上确实有 \" 水中毒 \" 这一概念，当人体摄入水量大大超过了排出量，以致水分在体内滞留，进而引起血浆渗透压下降和循环血量增多，就可能引起水中毒，它又被称为稀释性低钠血症，根据病情急缓，该病还可分为急性水中毒和慢性水中毒。</p>\r\n<p>然而，水中毒在临床上其实很少发生，就算患者真出现水中毒的情况，多半不单是由于过量饮水，而是因为患者身体出现了其他问题或者接受了某些不恰当的治疗操作。比如，患者本身就有肾脏疾病，加之心脏功能不全，运动后又一次性饮水过量，同时医源性输液过多，这就可能导致水中毒。实际上，健康人肾脏的适应能力很强，不会因为多喝了些水就 \" 罢工 \"。</p>\r\n<p>\" 只要不是短时间内猛喝，就不会对健康造成影响。\" 阮光锋说。</p>\r\n<p>喝水垢较多的水易患结石？</p>\r\n<p>真相：硬水口感不好，但不会危害健康</p>\r\n<p>烧水壶用久后，内壁会结下厚厚的水垢。网上盛传，长期饮用烧开后水垢很多的硬水，会增加罹患结石病的风险。那么这一说法究竟是真是假？</p>\r\n<p>阮光锋表示，水垢的生成与水的硬度有关，我国北方的水相较南方会更 \" 硬 \" 一些，这主要是因为其中钙离子、镁离子含量较多（这样的水也被称为硬水）。水中所含的钙离子和镁离子在高温加热时会变成难溶于水的矿物盐，沉淀在烧水壶内，这样就形成了水垢。</p>\r\n<p>\" 不过，目前尚无确凿证据表明，喝硬水会导致结石或其他健康问题。相反，如果人水喝得少、吃得多，其泌尿系统出现结石的可能性会更高。\" 阮光锋说。</p>\r\n<p>\" 喝硬水会导致结石，完全是个谣言。硬水虽然口感不好，但它对人体无害，其所含的钙和镁都是人体必需的元素，而且现在多数人的钙、镁摄入量都偏低。从这个意义上来说，喝硬度高的水，还能给人体补充一部分矿物质。当然，硬水中的矿物质含量，远不够人体日常所需，补充矿物质的正道，还是均衡的膳食。\" 阮光锋说。</p>\r\n<p>喝纯净水会骨质疏松？</p>\r\n<p>真相：导致钙流失的主因是年龄、激素水平等</p>\r\n<p>有传言称，纯净水又被叫作穷水，它在被处理时，其所含滋养人体的 \" 生命离子 \" 也被去掉了，越喝这种水体液会越酸。而且，纯净水会把人体内的大量微量元素带到体外，如此一来人就会骨质疏松，还会患上软骨病。那么，这些说法是真的吗？</p>\r\n<p>纯净水，是用反渗透方式或蒸馏方式制备的、去除了绝大多数杂质的水。华中科技大学同济医学院公共卫生学院副教授鲁青在接受媒体采访时表示，纯净水并非不含任何微量元素，只是经过处理后，其中钙、镁、钾、钠等人体必需的矿物元素显著减少。</p>\r\n<p>\" 人体体液正常的 pH 值在 7.35 到 7.45 之间，尽管机体在不断产生和摄取酸碱度不同的物质，但是体液的 pH 值并不会发生明显变化。纯净水属中性或弱酸性，经过人体胃液调和、肠道吸收，并不会改变脏器或其他组织的 pH 值。因此，对人体来说，喝纯净水并不会让体液越来越酸。\" 鲁青称。</p>\r\n<p>对于长期饮用纯净水会导致骨质疏松、软骨病的说法，科信食品与营养信息交流中心副主任钟凯表示，持此观点的人对人体生理情况不了解。一个 60 公斤重的成年人，其体液重量约为 36 到 42 公斤，而他一天的饮水量通常不超过 2 升。这样的饮水量对其体内的钙离子浓度没有影响，导致人体钙流失的主要因素是年龄、激素水平和膳食摄入等。</p>\r\n<p>另一方面，软骨病的发病原因为维生素 D 摄入不足、体内钙含量过低、日光照射不足等。人体摄入钙、镁等元素的主要途径是日常饮食，而非饮水。因此，饮用纯净水与软骨病的发生并无关联。</p>\r\n<p>这样喝水更健康</p>\r\n<p>最科学的喝水方式是什么？我们又该喝什么样的水？阮光锋给出如下建议：</p>\r\n<p>首先，喝水需适量。《中国居民营养膳食指南（2016 版）》推荐，成年男士每天饮水 1700 毫升，成年女士每天饮水 1500 毫升。当然，这个量也不是固定不变的，大家可以根据自己的情况进行调整。比如当天运动比较多、出汗多，就可以多喝；北方空气干燥，也可以适当多喝点水；若是进入炎热的夏季，还需根据劳动强度和出汗程度适当增加饮水量。</p>\r\n<p>很多人想问，每天应该喝几杯呢？一直有种说法，建议人们每天要喝 8 杯水。其实，具体喝几杯，还得看使用杯子的容量大小。我们日常的杯子容量为 200 毫升到 300 毫升，所以一般是 6 杯到 8 杯。</p>\r\n<p>当然，每个人杯子的容量都是不一样的，最好的办法就是根据自己杯子的容量大小，简单换算，不用苛求必须达到 8 杯。</p>\r\n<p>其次，喝水要注意少量多次。阮光锋表示，不要等到口渴再喝水，应该有意识地主动喝，并保证少量多次。</p>\r\n<p>此外，一些慢性病患者要注意多喝水，比如高尿酸血症、痛风、糖尿病患者多喝水，可在一定程度上减轻病症。</p>',NULL,1,1624021529,1624022932,NULL),
	(5,1,'少吃主食就能治好糖尿病？真相就在这里',NULL,'','http://cms-bucket.ws.126.net/2021/0618/b8338b34p00quvl31001hc0009c0070c.png?imageView&thumbnail=140y88&quality=85',NULL,'<p>有流言称，戒掉淀粉类食物、少吃果糖含量高的水果、不喝饮料、拒绝加工食品，就可以治好糖尿病。</p>\r\n<p>真相是：治疗糖尿病的方法有很多，大多情况下，病情的好转是饮食、运动、药物等多种方法共同作用的结果，不能以此为由片面夸大某种特定方法的功效。</p>\r\n<p>18世纪末，英国的John Rollo医生率先注意到低碳水饮食对于糖尿病的治疗价值。他所倡导的&ldquo;低碳水化合物饮食、高脂肪、高蛋白饮食模式&rdquo;影响深远，让人们认识到高碳水饮食对于糖尿病的不利影响，但也是当前众多饮食误区的思想源头，比如&ldquo;糖尿病患者不能吃水果&rdquo;&ldquo;随便吃菜不要紧&rdquo;等等。</p>\r\n<p>如果过度限制主食，长期不进食或极少进食碳水化合物，脂肪不得不过度提供热量，这对以葡萄糖供能为主的大脑和心肌代谢会带来不利影响；同时，高脂、高蛋白的过量摄入加重肝肾代谢负荷，心脑血管并发症的发病率也有可能因此升高。</p>\r\n<p>科学的糖尿病饮食模式并不是绝对、单一的，而是要针对每个人的不同口味、喜好等，在专业人员指导下，选择适合自己的个性化饮食，以健康的方式最大限度地继续享受喜爱的食物，而不能盲目追求某种饮食&ldquo;特效&rdquo;。</p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fcms-bucket.ws.126.net%2F2021%2F0618%2F31ab3c2dj00quvkzb001gc000go0073c.jpg&amp;thumbnail=660x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>中国医科大学航空总医院营养科张田主管营养师表示，对于糖尿病患者，饮食需要注意的地方有：</p>\r\n<p>控制每日摄入所有食物提供的总热量，以达到或维持理想体重；</p>\r\n<p>平衡膳食，选择多样化、营养丰富的食物；</p>\r\n<p>限制饱和脂肪酸的摄入量、适量选择优质蛋白质。在限制脂肪总量的前提下，应该尽量用植物油；限制饮食中胆固醇的摄入，不吃或少吃富含胆固醇的食物如动物内脏、蛋黄等；</p>\r\n<p>适当放宽对主食类食物的限制，减少或禁忌单糖及双糖的食物；</p>\r\n<p>进食高纤维膳食，多选择血糖指数低的食物。在饮食中可以适量选用粗粮(如荞麦面、燕麦片、玉米等)以及全谷类，多食青菜等；</p>\r\n<p>减少食盐的摄入，食盐量小于6克每日；</p>\r\n<p>少量多餐，进餐定时定量；</p>\r\n<p>多饮水，限制烟酒，戒烟；</p>\r\n<p>多用蒸、煮、炖或凉拌等方法加工食物，避免煎、炸、熏蒸或涮的方法加工食物。（综合北京市科学技术协会 北京卫健委 航空总医院）</p>',NULL,1,1624021649,1624021649,NULL),
	(6,1,'吃货看过来：冰淇淋与雪糕 究竟咋区分？',NULL,'','http://cms-bucket.ws.126.net/2021/0618/186df8eep00quvkx9001lc0009c0070c.png?imageView&thumbnail=140y88&quality=85',NULL,'<p>生活中，人们常常会把冰淇淋、雪糕混为一谈，即便知道有所区别，也很难说清楚。有人说看包装：盒装的是冰淇淋，有木棍的是雪糕；有人说看口感，软的是冰淇淋，硬的是雪糕。这些说法有一定道理，但不够严谨。其实，2014年颁布的国家标准对这两种冷饮做出了详细区分。首先，两者脂肪和蛋白质含量不同：国家标准规定冰淇淋脂肪含量&ge;5%，蛋白质含量&ge;2.2%；要求雪糕的脂肪含量&ge;1%，蛋白质含量&ge;0.4%，这是冰淇淋和雪糕的&ldquo;及格线&rdquo;。</p>\r\n<p>&nbsp;</p>\r\n<p>其次看感官特征。国家标准中提到雪糕的感官特征之一是&ldquo;冻结坚实，细腻滑润&rdquo;，而对冰淇淋的要求则没有&ldquo;冻结坚实&rdquo;。因为冰淇淋对脂肪含量要求更高，如全乳脂冰淇淋要求主体部分乳脂质量分数为8%以上，因此口感滑润的特征会更突出。</p>\r\n<p>如果还分不清，可以看包装。制作工艺中，冰淇淋的膨化率比较高，硬度较低，非常软，一般都用盒子、小碗或甜筒包装。而雪糕的含水量更高，膨化率较低，硬度高，一般会附着在木棍上。另外，一般产品包装袋上都会标注冰淇淋或雪糕，同时包装袋上的产品执行标准也有所不同，执行《GB/T31114》标准的是冰淇淋，执行《GB/T31119》标准的是雪糕。</p>',NULL,1,1624022779,1624022779,NULL),
	(7,1,'“上吊式”健身能治疗颈椎病吗？',NULL,'','http://cms-bucket.ws.126.net/2021/0618/440ceb80p00quvf5b001ic0009c0070c.png?imageView&thumbnail=140y88&quality=85',NULL,'<p>网传一些地区出现通过将头吊起，随绳摆动来治颈椎病的健身人群。“吊脖健身”锻炼类似临床上的“颈椎牵引”，热衷于“吊脖健身”的中老年人，以为让脖子受到牵引就对颈椎有好处，但答案是否定的。</p>\r\n<p> </p>\r\n<p>颈椎病是由于颈椎间盘或者小关节的退变，而导致邻近的脊髓、神经、血管受到刺激或压迫，并出现相应临床症状的一组疾病。颈椎退变多发生在下颈椎，病程长短不一，多数呈慢性病程，反复发作，逐渐进展。</p>\r\n<p>“上吊式”健身能治疗颈椎病？</p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fcms-bucket.ws.126.net%2F2021%2F0618%2F06e7dc9fj00quvezc0017c000go0073c.jpg&thumbnail=660x2147483647&quality=80&type=jpg\" /></p>\r\n<p>有流言称，将头吊起，随着绳子摇晃、摆动，这种“吊脖”健身能修复颈椎疾患。</p>\r\n<p>真相是：“吊脖健身”锻炼类似临床上的“颈椎牵引”，热衷于“吊脖健身”的中老年人，以为让脖子受到牵引就对颈椎有好处。但答案是否定的。像这种不正当的“吊脖健身”，牵引力量远大于临床治疗所需，可能会损伤神经组织、肌肉、肌腱和韧带等，加重病情，甚至可能会引起截瘫、危及生命。</p>\r\n<p>做牵引治疗需要遵循两个原则，即对症原则和适度原则。在临床上，有两种颈椎病适合牵引：一是慢性颈肩疼痛，通过适度牵引可以使紧张的肌肉松弛，有效缓解疼痛症状。二是神经根型颈椎病，临床上常表现为上肢放射性疼痛或发麻、感觉沉重及握力减退等症状，可以选择适当的牵引治疗，但切忌强度过大和时间过长，像上述的“吊脖”式锻炼肯定是不可取的。</p>\r\n<p>另外需要特别注意的是，临床上诊断为“\'脊髓型\'颈椎病、有眩晕症状的颈椎病、不稳定型颈椎病”禁做牵引治疗，原因是高强度的“吊脖”式牵引有可能将已经不稳定的椎间盘内核结构破坏，进一步压迫神经，加重疼痛、麻木症状，甚至有可能造成瘫痪、死亡等不良后果。</p>\r\n<p>因此，做牵引治疗前一定要到正规医院完善相关检查，经过专业医生评估后，在医生的指导下进行牵引治疗。</p>\r\n<p>学会几个小动作 让你远离颈椎病</p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fcms-bucket.ws.126.net%2F2021%2F0618%2F6ecfbfb5j00quvezc001oc000go0073c.jpg&thumbnail=660x2147483647&quality=80&type=jpg\" /></p>\r\n<p>颈椎病是属于退变老化的疾病，但近年来，颈椎病患病率不断上升，发病年龄逐渐呈现年轻化趋势，年轻的患者中有相当部分是电脑族或手机族。</p>\r\n<p>其实大部分颈椎病并不需要首选手术治疗。</p>\r\n<p>“脊髓型”颈椎病一般需要尽早手术，以挽救脊髓功能，避免造成不可逆的神经损害，出现不同程度的感觉活动障碍。</p>\r\n<p>“神经根型”颈椎病，早期可以保守治疗，药物，理疗，锻炼，相当一部分患者可以改善或维持，但严重压迫神经根保守治疗无效的，还是要积极手术减压。</p>\r\n<p>人体的脊柱并不是一根直棍，而是由7节颈椎、12节胸椎、5节腰椎和骶尾骨组成的柔软的、弯曲的“多节棍”，也是人体S型曲线的基础，颈椎部分存在生理前凸。</p>\r\n<p>维持正常的生理弧度可以最大程度的发挥伸屈功能、缓冲稳定和保护脊髓。因此，日常生活中注意保护颈椎，就可延缓颈椎的退变进程。对于已经有了颈椎病且正在治疗的病人来说，有效的康复锻炼同样有助于提高疗效，控制病变的发展。</p>\r\n<p>要避免长期低头伏案、使用手机、维持一个姿势不休息。工作一个多小时后，要站起来活动十分钟左右，让自己的身心得到适当的放松。</p>\r\n<p>双手交叉放在枕后，保持颈部轻微后伸，静止状态下，头向后使劲，手向前对抗，感觉颈部两侧肌肉收缩即可，坚持10秒钟放松。依此重复，每次10-15分钟，一天三次，一般坚持三个月左右，颈椎曲度可以逐渐改善，早期症状可能得到缓解。最重要的是，能够远离“真正的”颈椎病。</p>\r\n<p>仰卧在床上，去掉枕头，用四肢的力量抬起肩背部，持续3-5秒，然后肌肉放松，放下肩背部休息3-5秒为1个周期，以达到锻炼项背部肌肉的目的。同时还能有效地锻炼腰背部的肌肉，对慢性腰腿痛的病人也有益处。根据体力逐渐调整强度。</p>\r\n<p>游泳，特别是蛙泳的后伸动作，也是反弓的姿态，通过肌肉的锻炼，来增加颈椎的稳定性，让颈椎恢复到生理曲度。</p>\r\n<p>当颈痛等颈椎病症状较明显时，不宜锻炼，更不可盲目的推拿按摩，反而是应该适当休息。病情较重的需要到正规医院就诊，请骨科医生判断指导。在症状明显缓解后，才可以进行适当的颈部肌肉锻炼，以预防复发和进展。（综合北京市科学技术协会 北京市卫健委官网 北京清华长庚医院）</p>',NULL,1,1624022869,1624023744,NULL),
	(8,1,'千金难买老来瘦？越老越瘦越好吗',NULL,'','http://cms-bucket.ws.126.net/2021/0609/feba7c2cp00queolt001fc0009c0070c.png?imageView&thumbnail=140y88&quality=85',NULL,'<p>有那么一句老话，“千金难买老来瘦”。那么，对于老年人来讲，真是越瘦越好吗？可未必。如果老年人过度消瘦，一方面反映机体可能存在某些消耗性疾病，另一方面如果营养素摄入不足，机体营养不良，免疫力下降，也会增加患其他疾病的风险。今天，佑安医院营养师就来为老年人的体重管理支支招。</p>\r\n<p>老年人的胖瘦 判断另有标准</p>\r\n<p>对于老年人，什么样的体重才算适宜呢？现在，我们通常对于无严重疾病的老年人，用体质指数（BMI）来判断。体质指数（BMI）=体重（kg）/身高（m2），成年人的体质指数（BMI）划分是：＜18.5为消瘦，18.5至23.9为正常体重，≥24为超重，≥28为肥胖。老年人随着年龄增加，脊柱弯曲变形，身高较年轻时缩短，而体内脂肪组织增加，使得BMI相应升高。</p>\r\n<p>研究发现，如果老年人的BMI＞26.9，这类人群很容易患高血压、高血脂、高血糖及心血管疾病等，会缩短寿命。但如果老年人的BMI＜21.0，身体消瘦，营养素摄入不足，免疫力降低，当流感、肺炎等疾病发生时，死亡率要高于正常老年人。因此，老年人的体质指数（BMI）在21.0至26.9最为适宜。</p>\r\n<p>超重老人 步行健身减重最佳</p>\r\n<p>超重和肥胖的老年人如何科学管理体重？可以从以下七个方面着手：</p>\r\n<p>1.少量多餐，每餐吃七八成饱，若主食摄入较多，最好在原有饮食基础上每天减主食1至2两。</p>\r\n<p>2.每天膳食总能量的摄入在1000至2000Kcal之间，高能量食物应少吃或限制进食，如奶油糕点、糖果、含糖饮料等。</p>\r\n<p>3.增加膳食中食物纤维的摄入量，可多选择各种杂粮粥、杂粮主食、嫩玉米等食物，不仅减少了能量的摄入，且粗细粮搭配还有利于老年人血糖的平稳。</p>\r\n<p>4.减少膳食中脂肪的摄入，烹调油在原有饮食基础上每天减少10至20克，尽量少吃或不吃油炸、油煎、肥肉、奶油等食物。</p>\r\n<p>5.少喝含酒精饮料，尤其是白酒，其能量高且营养素少，不利于体重下降。</p>\r\n<p>6.每天坚持运动，步行、慢跑、打太极等。这些有氧运动都特别适合老年人，尤其步行是肥胖老人最好的健身方式。每天走1至2小时，可分次完成，每次不少于15至20分钟，以每分钟80至90步的速度行走为宜。</p>\r\n<p>7.定期监测体重，每周称重1-2次。减重不能急于求成，不能求快，只要体重较前一周下降，就说明控制有效。通过对饮食与运动方案的不断调整，使体重逐渐达到健康体重范围。</p>\r\n<p>消瘦老人 每日可加两三餐</p>\r\n<p>消瘦的老年人如何合理增加体重？别急，以下方法可以试试：</p>\r\n<p> </p>\r\n<p>1.增加餐次，每日除三餐主餐外，要有2-3次的加餐。</p>\r\n<p>2.食物种类多样，制作精细软烂，易消化吸收。</p>\r\n<p>3.每天可适当吃点零食，可选择老人爱吃、健康、含能量高的食物，如牛奶、酸奶、坚果、面包、蛋糕、饼干、纯果汁等。</p>\r\n<p>4.对于无运动限制的老年人，每天可适当运动，运动可以增加食欲，有助于食物的消化吸收。</p>\r\n<p>5.每天要心情愉悦，开开心心，保证充足的睡眠。</p>\r\n<p>6.定期监测体重变化，随时调整增重计划。</p>\r\n<p>文/本报记者 李洁</p>\r\n<p>通讯员 刘慧（北京佑安医院）</p>',NULL,1,1624023802,1624026777,NULL),
	(11,1,'温哥华新地标获2021全球最佳高层建筑奖',NULL,'','https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2Fb7ed600fp00qudv8r00ibc000tv018tm.png&thumbnail=650x2147483647&quality=80&type=jpg',NULL,'<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2Fa6650872p00qudv8r00eec000u000u0m.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　温哥华一号公馆荣获世界高层建筑与都市人居学会 (CTBUH)颁发的&ldquo;全球最佳高层建筑奖&rdquo;。在5月18日至20日举办的&ldquo;2021年高层建筑+都市人居先锋会议&rdquo;上，全球共有超过160个项目在28个类别的奖项中竞争，来自40多个国家的800多名同行参加了这一会议，最终，BIG设计的温哥华一号公馆获得全类别大奖。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2Fb7ed600fp00qudv8r00ibc000tv018tm.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2Fc840cc2bp00qudv8r00jxc000u00190m.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　温哥华一号公馆将成为这座城市未来新发展的重要组成，被誉为温哥华进入国际钻石地产城市行列的标志性建筑。它坐落于温哥华市中心南大门Granville Bridge旁，是通向市区的门户。塔楼及其基座是对当地城市类型学&ldquo;温哥华主义&rdquo;的新诠释：新城市主义裙楼配合细长塔楼，能够在保证视野的同时激活步行街。此外，这座住宅塔楼的选址得天独厚，居民在其中能同时欣赏到水景与山景，坐拥温哥华广阔丰富的水光山色。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F268d2f7fp00qudv8s00igc000u00190m.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F5b91e46ap00qudv8r00ccc000lg00w6m.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　塔楼所在场地被Granville Bridge一分为三，在这里设计住宅困难重重。BIG就接受了在道路和密集坡道之间设计高密度住宅的挑战，兼顾建筑的容积率与地标性，为满足道路、桥梁需设30米退线的市政要求，建筑地基呈三角形。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2Fb2c37dc5j00qudws3003ld000v900fmp.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F0bdc01f1j00qudws3005ld000k600xdp.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　但随着建筑的升高，塔楼逐渐变为矩形（为实现从底层三角形到顶层矩形的过渡，塔楼采用大量斜柱或阶梯形柱；为实现空间悬挑，每一层阶梯形柱设计有些微偏移）。这样下窄上大的扭转轮廓也改变了过去这片区域的嘈杂、混乱。由此，我们利用设计上克服了地块的不足，强化了空间使用。同时，它也为温哥华天际线增添了亮丽的一笔，并在底层提供了宽敞的公共空间。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F102ce867p00qudv8q007lc000u000k0m.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F48470d2fp00qudv8r00i0c000u00190m.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　温哥华一号公馆的裙楼仿佛是一个多功能的&ldquo;都市村&rdquo;。地块内的三座三角形综合体由面向公共广场及道路的工作、购物和休闲空间组成。我们还在现有街道的基础上增添了公共空间，为社区提供各种规模的开放户外场所，以满足不同用途及活动的需要。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F6cd149b8j00qudwsn004sd000v900ktp.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2Ffb1bdeb5p00qudv8r00m1c000qm00zem.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　温哥华一号公馆所在地原没有合理的基地空间，场地位于温哥华最繁忙的立交桥下，且地块为三角形。经大胆构想与审慎设计，这一塔楼拔地而起，将原本低效的城市边角地改造为城市中最醒目的地标建筑（西岸置业集团在温哥华规划了&ldquo;天际线计划&rdquo;，旨在以地标建筑为行业发展切入点、重新定义城市天际线）。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F648ecbb3p00qudv8q00a8c000u000mfm.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2Fc65ae15dp00qudv8q00l2c000u000mim.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F2f9df674p00qudv8r003nc000u000mim.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2Fabc169e4p00qudv8s003uc000u000mim.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F66b7ea44p00qudv8s003xc000u000mim.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2Fae6a3fb5p00qudv8t003xc000u000mim.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F26a0c4d4p00qudv8t0041c000u000mim.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F4f096fe0p00qudv8s003yc000u000mim.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F19993c26p00qudv8t003xc000u000mim.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F9fa4ea6dp00qudv8t0040c000u000mim.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F8e9eb048p00qudv8t0046c000u000mim.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2Fcf8146a3p00qudv8t004pc000u000mim.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F4404db3dp00qudv8t0047c000u000mim.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2Fb57ccd91p00qudv8t0048c000u000mim.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0608%2F0b47d55bp00qudv8t0047c000u000mim.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　项目名称：温哥华一号公馆</p>\r\n<p>　　项目类型：住宅</p>\r\n<p>　　项目进展：已完工</p>\r\n<p>　　项目规模：60600㎡</p>\r\n<p>　　项目地点：温哥华，加拿大</p>\r\n<p>　　委托方：西岸置业集团</p>\r\n<p>　　项目团队：</p>\r\n<p>　　合伙人：Bjarke Ingels，Thomas Christoffersen，Beat Schenk</p>\r\n<p>　　项目负责人：Agust&iacute;n P&eacute;rez-Torres</p>\r\n<p>　　项目经理/设计师：Carl MacDonald，Melissa Bauld</p>',NULL,1,1624071231,1624071231,NULL),
	(12,1,'清华艺博回顾“百年设计史”，探讨历史视野中的设计现代性',NULL,'','https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2Faade2076j00qu66ah0066c000jg00czg.jpg&thumbnail=650x2147483647&quality=80&type=jpg',NULL,'<p>　　1880至1980年，是设计史中重要的百年。其间，工业已在各个领域发挥它的作用，人们也意识到设计实乃工业造福万民的翅膀。</p>\r\n<p>　　澎湃新闻获悉，6月3日，特展&ldquo;设计乌托邦1880-1980：百年设计史/比亚杰蒂-科尼格收藏&rdquo;在清华大学艺术博物馆开幕。展览通过158件现代设计展品，呈现这百年来现代设计的历史，也展现出这些设计产品背后的设计者的思想、精神，以及各时期的社会形态。</p>\r\n<p>　　当天下午，主办方还举办了&ldquo;历史视野中的设计现代性&rdquo;研讨会。</p>\r\n<p>　　1880-1980：百年设计史</p>\r\n<p>　　澎湃新闻了解到，比亚杰蒂-科尼格设计收藏（The Biagetti-Koenig Collection）则来自一个关注现代设计的家族，由意大利设计博物馆（Musei Italiani）负责管理，他们的收藏跨越了一个多世纪，伴随着现代设计的诞生、延展、变异的全过程。</p>\r\n<p>　　展览展出的158件现代设计作品以家具为主，涵盖现代设计史的领军人物，如查尔斯&bull;雷尼&bull;麦金托什、安东尼&bull;高迪、阿道夫&bull;路斯、弗兰克&bull;劳埃德&bull;赖特、路德维希&bull;密斯&bull;凡&bull;德&bull;罗、勒&bull;柯布西耶、阿尔瓦&bull;阿尔托、卡洛&bull;斯卡帕、吉奥&bull;庞蒂、野口勇、埃罗&bull;沙里宁、马里奥&bull;贝里尼、喜多俊之等人，横跨设计史至关重要的100年，影射出这一百年间持续不断创新的鲜活历史，构成一部现代主义设计发展史的缩影。<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2Faade2076j00qu66ah0066c000jg00czg.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　展厅现场</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2F098141ecj00qu66ai0029c000u000k0g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　展览现场</p>\r\n<p>　　&ldquo;当居住成为一种具有文化性和决定性的现象，它便与精神意图相关，而非仅仅为了生存，于是这种现象就成了一种&lsquo;行为文化&rsquo;。这样一来，生活便从基本水平向更高的水平迈进了。无论积极的还是消极的，两个多世纪以来，工业已经在各个领域发挥它的作用，不论工业或伪工业、工业手工艺品或手工业，并且延伸至世界最遥远的角落。传统的制造生产系统即将退出历史舞台。&rdquo;对于此次展览，策展人亚历山德罗&middot;格里罗这样写道。</p>\r\n<p>　　1890年，一场专注于解读&ldquo;现代性&rdquo;概念的艺术文化运动出现，即新艺术运动。该运动使用现代性的视觉语言，拒绝对传统的参照，并发展出新的设计风格。建筑师对这一时期的设计发展起到关键性作用，因为他们在建筑和装饰艺术之间建立起密切的联系，满足了新兴社会阶层的需求。<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2Fa953340cj00qu66aj006gc000jg00t6g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　迈克尔&middot;索耐特，14号椅，1860年</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2Fcf51e2f8j00qu66aj007ec000jg00ubg.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　安东尼&middot;高迪，卡尔维特挂镜，1898-1904年</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2F50d0763cj00qu66ak008uc000jg00t6g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　查尔斯&middot;雷尼&middot;麦金托什，柳茶室1号高背椅，1904年</p>\r\n<p>　　20世纪初是艺术先锋派代表对&ldquo;新现代性&rdquo;的最重要探索，通过摆脱传统并尝试新的视觉语言，积极参与到当时的社会大复兴之中。 构成主义、至上主义、未来主义和荷兰风格派的艺术运动成员，通过作品塑造出一种新的社会模式。</p>\r\n<p>　　1925年，在巴黎举行的国际装饰艺术博览会标志着设计新时代的开端，截然不同的思想流派并存共进。正是在此期间，&ldquo;设计师&rdquo;的概念得到明确的定义，设计师不必具有正式的建筑领域背景。<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2F0474dffbj00qu66al007ac000jg00t6g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　弗兰克&middot;劳埃德&middot;赖特，中途岛2号椅，1913年</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2F8e13206fj00qu66am005jc000jg00t6g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　赫里特&middot;托马斯&middot;里特维尔德，红蓝椅，1918年</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2Fcd40c7f6j00qu66am0063c000jg00t6g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　瓦尔特&middot;格罗皮乌斯，F51扶手椅，1920年</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2F36abbe75j00qu66an001fc000jg00t6g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　奥托&middot;里特维格，L20包豪斯台灯，1924年</p>\r\n<p>　　之后的30年代初，设计方法发生了翻天覆地的变化，新视觉语言的出现与现代主义运动的理念形成鲜明对比。弗兰克&middot;劳埃德&middot;赖特倡导有机设计，他致力于创造人与自然的和谐，并视建筑为平衡人造世界与自然世界的一种手段，他通过使用天然材料和光洁圆润的形式来表达这一理念。在斯堪的纳维亚，这种趋势与&ldquo;民主设计&rdquo;重合，是一种改善日常生活的方式。</p>\r\n<p>　　二战后，新一代建筑师和设计师逐渐崭露头角，他们的理念扎根于现代主义思想。现代主义运动的代表人物因欧洲战争逃至美国避难，也将现代主义带到了美国。这些现代主义思想成为经济复苏的重要组成部分。意大利设计界投身到全国道德和物质重建中，利用新工业化为设计领域打开视野。艺术性实验的广泛传播和20世纪60年代中期的青年抗议运动为意大利设计界注入了全新的创造力，并与新技术产生互动。塑料的运用是巩固创意与工业化纽带的关键，因为它让设计师有机会以更具煽动性的方式表达自我，并产生了后来的&ldquo;激进设计运动&rdquo;。<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2Fd2405b89j00qu66an005zc000jg00t6g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　阿尔瓦&middot;阿尔托 帕米奥，41号扶手椅，1933年</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2F42e63c00j00qu66ao0080c000jg00t6g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　加塔诺&middot;佩斯，UP5系列扶手椅，1969年</p>\r\n<p>　　埃托&middot;索特萨斯，卡萨布兰卡柜架，1980年</p>\r\n<p>　　展览中的展品是上世纪工业大爆发所投射出的碎片，其背后是一个个伟大人物的思想和技术发明的支撑。主办方希望展览不仅仅是为了唤起我们对设计的现代主义历程的回忆，而是铺陈展示出来更多的线索，让人们再一次思考。</p>\r\n<p>　　清华大学艺术博物馆副馆长、清华大学美术学院教授苏丹表示，&ldquo;现代设计的维度是极为多向的，这也就意味着它的形成过程充满着波折、迂回和交替。它可以遵循传统文化的脉络发展，可以与物理进行抗争和平衡，还可以沿着科学发现的线索努力拓展。&hellip;&hellip;表面上看去这些杰作针对了历史中的不同问题，展现了各自非凡的才华。但现代设计的出发点却是大工业生产和机器，人类怀着喜忧参半的心情面对这个新生的、完全陌生的事物。这时需要一种媒介，将旧有的传统和新生的事物进行调和、嫁接、变通，让人类顺畅地步入一个想象和期盼中的新世界。&rdquo;</p>\r\n<p>　　历史视野中的设计现代性</p>\r\n<p>　　当天下午，在清华大学艺术博物馆四层报告厅还举办了本次展览的开幕研讨会&ldquo;历史视野中的设计现代性&rdquo;。研讨会由苏丹与陈岸瑛主持，王受之、王辉、王海松、尤洋、方晓风、朱青生、李兴钢、张永和、范晓楠、杭间、周榕、周艳阳、柳冠中、唐克扬、黄居正、曾辉等十六位专家学者在研讨会中回顾和反思设计史与当代生活文化之间复杂而有机的互动，并在新的世界历史变局中重提设计的现代性问题。澎湃新闻特此整理刊发部分专家观点。<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2F09b8ed4bj00qu66aq003ac000u000jqg.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　研讨会现场</p>\r\n<p>　　研讨会中的第一个话题是&ldquo;回顾与展望&rdquo;，关于设计史意义的本身，以及设计史跟客观事实之间的话题。建筑教育专家、建筑师张永和从分析一把椅子的设计、工艺开始，谈及了观看设计不仅需要看结果，还需要看设计的过程。同时，他也谈及了设计与手工艺件的关系，&ldquo;在设计概念出现的那个时刻，其实并没有把手艺完全抛弃，而是造成了这两者之间的融合，造成了从手艺到设计的过渡。当然，在今天回头看这个过程，并不是设计和手艺之间的对立，而是一个包容关系。只有在了解这个过程的时候才能理解这种丰富性和复杂性。实际上，现代主义以及有一批现代建筑师曾经激烈的反对的古典主义，实际上也是延续融合的关系。所以，现在看到的有些认为非常重要的现代建筑师、设计师，恰恰因为他经历的那个处于在古典和现代之间的混沌时期，所以他们有了对建筑的一个特殊的认识，有了他们自己的风格。&rdquo;</p>\r\n<p>　　设计史论专家和研究者王受之谈及了展览的全面性，他表示，设计从新古典主义结束以后，进入了一个阶段，这个阶段是很不认同机械化的工业生产。而此次展览则是基本上能够把一本现代传统设计史反映的比较完整。中国美术学院美术馆馆长、艺术史学者，批评家杭间则谈及了对于设计的描述方式，包括对设计师、设计作品的功能、材料等。他表示，&ldquo;设计史还是一门非常年轻的学科，还在不断地判断、在成长、在发展的过程中。如何真正的设计史应该是一个什么样的描述方法，设计史绝对不会只是一种描述方式，而是很多种的角度。&rdquo;<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2Ffe8b0dd7j00qu66ar004yc000jg00t6g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　阿道夫&middot;路斯 卡布瓦，咖啡馆AL1挂衣架，1913</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2Fe94d4f86j00qu66ar007uc000jg00t6g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　彼得&middot;凯勒，瓦西里&middot;康定斯基式摇篮，1922年</p>\r\n<p>　　研讨会的第二个话题是&ldquo;理想与现实：重提设计现代性&rdquo;。北京大学历史学系教授朱青生认为，设计史跟艺术史是互为表里、互为联合的一个方面。他表示，一个艺术史家应该有三个方面的可能性：他应如历史学家，应该用文献、语言来承载我们的思想和感觉；同时他应该也能够处理物，就像考古学家一样的去处理；同时，他要会处理图像。图、词、物加在一起才是今天我们接受世界和解释未来的可能，这是今天艺术史学发展的新方向。<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2F583114a7j00qu66as0050c000jg00czg.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　展厅现场</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2F4c2ce418j00qu66as0041c000jg00czg.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　展览现场</p>\r\n<p>　　清华大学美术学院副院长方晓风谈论了设计展览的展示问题。设计展和艺术展的区别到底在哪里？&ldquo;展览承载了100年的时间信息。但是这个时间信息如何展现？物与物之间怎么产生关系。大众能从这个展览里读出多少信息，这也是对现代性的考问。我们应该给观众一种自己去组合信息、挖掘信息背后的可能性。这可能是现代性的一种表达，不是告诉你，而是给你一定便利和途径，去发展对这个信息的解读。&rdquo;清华大学建筑学院副教授、建筑批评家周榕对乌托邦提出了自己的观点，认为它是虚拟的，真空的，由精英分子构筑的虚拟社会、虚拟世界，产生了很多新的物种，当然新物种进入到现实有一个自然淘汰的过程。&ldquo;整个设计史是一个社会学问题，它不是一个纯学术问题，也不是一个纯艺术问题。这些产品跟资本，跟传播，跟人的状态有非常大的关联，包括它的生产流程，是一个综合的社会学问题。&rdquo;</p>\r\n<p>　　在关于&ldquo;中国设计未来的想象&rdquo;的话题中，上海大学教授、建筑学者王海松表示，展厅的一些产品是百年前设计的，但在现在看依旧非常好。展览是一部设计史，其意义是对我们有很大的触动，思考我们怎么去做出引领性的东西。清华大学文科资深教授柳冠中则表示，看待产品，例如椅子的设计，必须看到椅子背后的人和处在不同的时代和社会。&ldquo;所以设计绝对不是一个简单的物，看的是物背后的事。&rdquo;</p>\r\n<p>　　《建筑学报》执行主编黄居正以&ldquo;风土&rdquo;一词表达设计中传统与国际的关系。&ldquo;设计应该是表达风土的，它应该是表达此时此地的风土。风土一定是既有过去的，也有现在的，也有当下的。这两者之间无论是做工业设计，还是做产品设计，还是做建筑设计，这两者之间永远要不断地被反复讨论，所以两者之间具有非常强大的张力在里面。同时，设计师应该进行跨文化的尝试者，这样才可以既把握到所谓的风土，也把握到国际的潮流，才能有真正的所谓的创造性。这两者之间应该以跨文化的视角去看，无论哪个国家和哪个地方都可以成为你设计的基本的出发点。&rdquo;<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2Ff6d8c363j00qu66at006ec000jg00t6g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　吉奥&middot;庞蒂， OO24吊灯， 1931年</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2F5731afe6j00qu66at007ic000jg00s5g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　野口勇，Akari H吊灯，1951年</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0604%2F5ce4adbaj00qu66au00c5c000jg00t6g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　亚历山德罗&middot;门迪尼，普鲁斯特扶手椅，1979年</p>\r\n<p>　　北京国际设计周策划总监曾辉谈及了设计产品的寿命问题。&ldquo;我们看的这个展里有很多作品，不仅仅都是活化石，其实仍然是在活着的设计。从这个意义上来讲，反思中国设计面临的问题，很多产品是一时的爆款，但不长久，没有美学寿命，而有些产品质量寿命还行，但它的美学寿命是短暂的。我们应该思考当代的设计如何建立起新的美学价值观，如何让它真正的可持续创造经久耐用的东西。这是我们应该给社会，给人类创造的价值。 &rdquo;最后，尤伦斯当代艺术中心馆长尤洋表示，中国设计的未来，除了跟设计师有关以外，其实跟设计史论的学科建设、设计的展览、策划和设计博物馆的建设是相关的。</p>\r\n<p>　　展览&ldquo;设计乌托邦 1880-1980：百年设计史 / 比亚杰蒂-科尼格收藏&rdquo;将展至8月25日。</p>',NULL,1,1624071282,1624071282,NULL),
	(13,1,'“设计上海”第八年，看不同视角下的“中国语言”',NULL,'','https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0603%2F3f1308f7j00qu4fbs003bc000go00b4g.jpg&thumbnail=650x2147483647&quality=80&type=jpg',NULL,'<p>　　6月3日至6月6日，&ldquo;设计上海&rdquo;在工银中心上海世博展览馆举行，展览分为当代设计、新材料与应用等八大板块。去年展会上新设的TALENTS和新开物板块也迎来第二次亮相。</p>\r\n<p>　　&ldquo;设计上海&rdquo;展会总监谭卓表示，希望展会能够为设计与社会议题的有机融合提供新思路。2014年，&ldquo;设计上海&rdquo;首次举行，当时中国设计还很稚嫩，设计行业也仍是十分初步的状态。如今，进入第8个年头，不少国际设计师和品牌亲历了中国市场的发展，而对于本土设计师而言，如何在世界语境下思考中国设计的方向成为了他们实践的一大关键。</p>\r\n<p>　　进入中国的世界设计</p>\r\n<p>　　在展会现场，澎湃新闻记者看到不少外国展商的身影。今年&ldquo;设计上海&rdquo;在去年的基础上扩大超过25% 的展览面积，汇集来自30多个国家和地区的400多个国内外高端设计品牌和独立设计师作品。相比于去年因疫情而两度延期，今年的&ldquo;设计上海&rdquo;让人看到疫情影响之下经过隔离等控制的国际交流新常态。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0603%2F6ec58a16j00qu4fbq002xc000go00b4g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /><br /><br /></p>\r\n<p>　　2021&ldquo;设计上海&rdquo;现场</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0603%2F9ee30f64j00qu4fbr009xc000go00p0g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　2021&ldquo;设计上海&rdquo;现场</p>\r\n<p>　　在当代设计馆，与全球设计师合作的品牌 HAY、拥有百年历史的家具制造商 Carl Hansen &amp; S&oslash;n、结合传统和创新的设计公司 &amp;Tradition都来自丹麦，它们共同展示了北欧设计风格。2014年，&ldquo;设计上海&rdquo;首次举办，Carl Hansen &amp; S&oslash;n 也进入中国，其中国区品牌负责人Eric Tsai回忆道，当时中国的设计市场谈不上成熟。&ldquo;对比亚太区的其他国家，日本、韩国的市场已经拥有充分的设计教育，形成了较稳定的市场环境。中国市场则还在成长中，比较浮躁。那时候中国的节奏走得很快，但总是跟风&hellip;&hellip;所有人都在寻找好东西，但很少有人能静下心来去了解它们为什么好，背后的价值是什么。&rdquo;与此同时，他们也看到了中国市场的潜力，&ldquo;一些酒店、咖啡厅等公共空间越来越喜欢北欧的简约风格，还有一些丹麦品牌开始在中国开店、参展。&rdquo;</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0603%2F207b9413j00qu4fbr0013c000go00b4g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /><br /><br /></p>\r\n<p>　　2014年的&ldquo;设计上海&rdquo;Carl Hansen &amp; S&oslash;n的展位</p>\r\n<p>　　HAY也是较早进入中国的北欧品牌之一，其代表Kim Bukbjerg Fiedler认为，相较于过去对于家居用品相对单一的需求，中国近十年的发展可谓突飞猛进，&ldquo;新的消费群体释放潜力，市场对设计、工艺、功能、个性化的需求和关注也日趋增多。&rdquo;而去年的疫情也带来了一些影响，&ldquo;大家被迫长期地待在家中，可能对&lsquo;家&rsquo;的需求提升了一个度，对&lsquo;家&rsquo;的概念也有了新的定义。&rdquo;Fiedler分析道。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0603%2F3f1308f7j00qu4fbs003bc000go00b4g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /><br /><br /></p>\r\n<p>　　HAY的家具</p>\r\n<p>　　融入日本元素的Stellar Works与意大利建筑师 Michelle De Lucchi共同呈现新作。Michele De Lucch曾在著名的孟菲斯运动（Memphis）中崭露头角。此次在&ldquo;设计上海&rdquo;中，他设计的&ldquo;Float&rdquo;沙发系列由几近隐形的结构支撑，如同悬浮在空中，配件的自由组合设计增加了对不同空间的适用性，De Lucch希望在工业化的现代重现自由的空间。来自美国纽约的时尚家居品牌departo则以现代人移动创新的生活方式为灵感，从陶瓷和玻璃器皿，到纺织品和服饰，不同产品可以单独使用，也能进行组合。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0603%2F8b166d97j00qu4fbs000gc000go00b5g.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /><br /><br /></p>\r\n<p>　　Stellar Works 作品</p>\r\n<p>　　中国的设计&ldquo;语言&rdquo;</p>\r\n<p>　　除了国际设计，不少中国本土品牌与设计师也出现在此次&ldquo;设计上海&rdquo;中。在这些年的办展过程中，&ldquo;设计上海&rdquo;也累积了对中国设计的观察。2000年前后还是中国设计萌芽的初期，而2014年&ldquo;设计上海&rdquo;的首次举办是国内设计环境转变的一个重大信号。此后，新兴的国内设计品牌也开始有了发展。于是，很多人都会思考，中国设计是否能有足够的力量，成为国际化的品牌呢？</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0603%2F421e31eaj00qu4fbt001qc000go008rg.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /><br /><br /></p>\r\n<p>　　一把交椅</p>\r\n<p>　　成立于2008年的中国设计品牌U⁺希望在世界语境下重新思考中国设计的方向。联合创始人沈宝宏与谭晓慧认为，在世界范围里，中国传统的文化只是一部分，不能代表全部。&ldquo;当现在的中国人审视自己的生活时，如果只用&lsquo;传统&rsquo;来解释是远远不够的，一定会有世界性的语言参与其中。&rdquo;今年是U⁺首次参与&ldquo;设计上海&rdquo;，其新作 &ldquo;一把交椅&rdquo;沿袭传统交椅的形制，坐面与椅背一体成型；&ldquo;听园茶几&rdquo;则以温润造型体现设计对人的关心。&ldquo;中国人的审美提升非常迅速，甚至远远超过了设计师对产品理解的水平。对于U⁺这样的中国设计品牌来说，要真正走入国外的民用市场，依然有一段距离。今年的新品其实已经积累了很多年了，我们思考得很慢，毕竟这是一个新的尝试。&rdquo;</p>\r\n<p>　　去年，&ldquo;设计上海&rdquo;开设了新开物版块，由设计师陈旻策划。&ldquo;新开物&rdquo;的名字取自明代科学家宋应星的著作《天工开物》，&ldquo;开物&rdquo;指的是利用人工对自然所进行的创造生产，而&ldquo;新开物&rdquo;代表的是艺术、工艺和设计之融合。通过聚集设计师、匠人与艺术家的作品，&ldquo;新开物&rdquo; 想要对人工的创造进行反思，让手作的温度带回人类文明的线索。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0603%2F130fc5edp00qu4fbu006oc000go009ig.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /><br /><br /></p>\r\n<p>　　间物花器 中国 郝振瀚</p>\r\n<p>　　今年的&ldquo;新开物&rdquo;被翻译为&ldquo;neooold&rdquo;，即新（neo）与旧（old）的结合，基于中国传统手工艺和材料资源，邀请全世界的设计师进行创作。郝振瀚的&ldquo;间物花器&rdquo;名称取自拉丁语Tertium quid，意为两种已知元素结合生成的一种未知元素，作者将布料与泥浆融为一体，最终的产物既有布料的柔软又有陶瓷的坚硬质地。日本设计师寺山纪彦从固着动物藤壶身上找到灵感，这种动物将粗糙不平的物体表面作为附着点，并相互覆盖，在物体表面形成一个新的外衣。在作品《藤壶的结构》中，模具表面叠上多层陶瓷后，形成了一个新生的&ldquo;壳&rdquo;。内里是人造的结构，表面是不可预测的藤壶般生长形成的外壳。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0603%2F78a4f924p00qu4fbu005rc000go009tg.png&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /><br /><br /></p>\r\n<p>　　《藤壶的结构》寺山纪彦</p>\r\n<p>　　在去年的采访中，被问及什么是设计中的&ldquo;中国语言&rdquo;，陈旻认为，&ldquo;这应该由广大中国设计师以及在中国做设计的外国设计师通过自身对当时当地的理解，做出的一种设计诠释，它一定是一个综合的概念&rdquo;。而语言与标签大不相同，&ldquo;极少有设计师艺术家会安于标签，标签和风格一样，是一个封闭的死循环，排斥有创造性的发展，更禁止突破。而语言是开放的系统，兼容并包，与时俱进，是不断在进化的体系&rdquo;。</p>',NULL,1,1624071334,1624071334,NULL),
	(14,1,'高703米！俄罗斯计划建世界第二高摩天楼',NULL,'','https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0528%2F005c0100j00qts2ml0015d000m500tbp.jpg&thumbnail=650x2147483647&quality=80&type=jpg',NULL,'<p>　苏格兰建筑师Kettle Collective于2021年5月25日宣布了建造超级摩天楼的计划，并公布方案效果图。该塔名为&ldquo;拉赫塔中心2号&rdquo;，建在俄罗斯圣彼得堡，高703米，将顶替上海中心大厦排名，成为仅次于迪拜哈利法塔的世界第二高楼。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0528%2F005c0100j00qts2ml0015d000m500tbp.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　尽管哈利法塔更高，但新的拉赫塔中心2号（Lakhta Center II）将拥有世界上任何建筑物中最高的楼层和观景廊。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0528%2F8f369b5cj00qts0fd0043c000u000u0m.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0528%2Fd64740c5j00qts0fd0057c000u000jvm.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　△拉赫塔中心（已建成）</p>\r\n<p>　　已建成的拉赫塔中心高462米，是当下欧洲第一高楼。新的拉赫塔中心2号一旦建成，圣彼得堡成为世界少有的拥有两栋450米以上的摩天之城。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0528%2Fd41f3340j00qts0fd001uc000u0013zm.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　△拉赫塔中心2（未建成）</p>\r\n<p>　　拉赫塔中心2号将容纳开创性的多轿厢升降机，该升降机通过升降机的移动产生的能量来再生动力，被视为对拉赫塔中心的补充发展。</p>\r\n<p>　　凯特尔先生说：&ldquo;新的拉赫塔中心将成为全球高层建筑可持续设计的模板。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0528%2F8156d387j00qts2z2000kd000uk00h7p.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0528%2Ff7fbe565j00qts2z8000md000q000efp.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　&ldquo;它将具有一流的低能耗设计和多种用途，将创建一个垂直的中庭空间，以充满活力的中心作为这个新商业区的心脏。&rdquo;</p>\r\n<p>　　他补充说：&ldquo;设计既美观又实用，因为它将减少会影响结构的相当大的风力，从而减小建筑物内所需结构元件的尺寸。&rdquo;</p>\r\n<p align=\"center\">　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0528%2F594593eaj00qts0fd0027c000u000k0m.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　△拉赫塔中心2建成后的新天际线效果</p>\r\n<p>　　新的拉赫塔中心2号将拥有150层以上的客房。</p>\r\n<p>　　顶层将达到590米，成为全球最高的楼层和观景廊。</p>\r\n<p>&nbsp;</p>',NULL,1,1624071390,1624071390,NULL),
	(15,1,'用摄影作品告诉您我国共有37处世界文化遗产',NULL,'','https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0615%2F33f8fb94j00qupkyh004ic000u001luc.jpg&thumbnail=650x2147483647&quality=80&type=jpg',NULL,'<p>世界文化遗产在中国</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0615%2F33f8fb94j00qupkyh004ic000u001luc.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0615%2Fd8e64413j00qupkyh003wc000u001ipc.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0615%2F53c78b49j00qupkyh0093c000u002kbc.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0615%2Ffbeb0deaj00qupkyi007jc000u002esc.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0615%2F2e91f3e4j00qupkyh007ec000u002awc.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0615%2Fd03fa264j00qupkyh007pc000u002g0c.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0615%2Fd8a4b578j00qupkyh0030c000u001mxc.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0615%2F06f83c8dj00qupkyi0098c000u002dnc.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0615%2F2ce40bdfj00qupkyi007hc000u002i8c.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type