;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F9de08e30j00qunyey006pd200u000u0g00ic00ic.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F2efbd90cj00qunyey003dd200u000u0g00ic00ic.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fa3bf3939j00qunyez001sd200u000tyg00ic00ia.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fe8aebba6j00qunyez0069d200u000u0g00ic00ic.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F2243100fj00qunyez006jd200u000u0g00ic00ic.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fc3ef5fc1j00qunyf00032d200u000u0g00ic00ic.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F6e138e95j00qunyf0003ud200u000u0g00ic00ic.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F4113f080j00qunyf0003dd200u000u0g00ic00ic.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fc2012269j00qunyf1005jd200u000u0g00ic00ic.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F1c215eb4j00qunyf10016d200u000u0g00ic00ic.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　ins： hamadahideaki</p>\r\n<p>　　- END -</p>\r\n</div>\r\n<div>&nbsp;</div>',NULL,1,1624071603,1624071603,NULL),
	(17,1,'100多年前的老照片，上色后竟有一种异常的厚重感，太震撼了',NULL,'','https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F8867f6fdj00qunyae001od200go00dcg00go00dc.jpg&thumbnail=650x2147483647&quality=80&type=jpg',NULL,'<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F8867f6fdj00qunyae001od200go00dcg00go00dc.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　日本弓箭手，大约拍摄于1860年，上色彩照。</p>\r\n<p>　　摄影是对客观世界影像真实的记录，摄影作品的价值首当其冲是它的文献价值，其次才是它的艺术价值。</p>\r\n<p>　　今天你看见的这组照片，它的价值不在于它的艺术性，而是它强力的文献价值。</p>\r\n<p>　　这是100年前也就是19世纪末20世纪初的彩色影像，彩色影像相对于黑白影像尤为珍稀，何况它是在百年前。</p>\r\n<p>　　何况它是对百年前世界主要国家主要城市的地理风貌，城市风光，民族风貌的彩色影像记录，珍贵之处可想而知。</p>\r\n<p>　　这些照片主要珍藏在大学大图书馆或者影像博物馆，这些照片你只要有一张完全可以在美国纽约买一栋房子不成问题。</p>\r\n<p>　　德兰/文</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fa3a0f3faj00qunyae002ad200go00j8g00go00j8.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1863年，美国葛底斯堡，三个联邦囚犯。上色彩照。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F23f706f9j00qunyae002vd200go00ijg00go00ij.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1865年，南北内战期间，南卡罗来纳州查尔斯顿港口舰艇上的小男孩与舰艇大炮。上色彩照。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F952dbfd3j00qunyae002cd200go00rag00go00ra.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1865年，美国，弗朗西斯&middot;布劳内尔士兵，南北战争期间他获得第一个荣誉勋章。上色彩照。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fca65d796j00qunyaf000nd200go00ctg00go00ct.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1880年，日本，梳洗。Kimbei/摄，手工上色。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F56a01b24j00qunyaf001md200go00n0g00go00n0.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1880年，瑞典和挪威国王奥斯卡二世。上色彩照。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F48c55ebfj00qunyaf002sd200go00c5g00go00c5.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1895年，西班牙巴塞罗那，斗牛盛会。手工上色。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fff2e1be6j00qunyaf002gd200go00c7g00go00c7.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1895年，土耳其伊斯坦布尔市，街边理发、拔牙摊贩。手工上色。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fb4a17577j00qunyaf001pd200go00c9g00go00c9.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1897年， 比利时一处港口风光。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F1f653293j00qunyag0021d200go00cmg00go00cm.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1899年，美国犹他州，印第安人。手工上色。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fc983ed9dj00qunyag002bd200go00c4g00go00c4.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　巴勒斯坦，耶路撒冷城市景观。照片大约拍摄于1890-1900年之间。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F05bef738j00qunyag002kd200go00cag00go00ca.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　巴勒斯坦，耶路撒冷雅法门。照片大约拍摄于1890-1900年之间。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F02008d1ej00qunyah003sd200go00m9g00go00m9.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　巴勒斯坦，基督救世主教会。照片大约拍摄于1890-1900年之间。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F9446881cj00qunyah002od200go00mog00go00mo.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　巴勒斯坦，一位来自伯利恒女人的肖像。照片大约拍摄于1890-1900年之间。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fa69180d6j00qunyai002cd200go00c7g00go00c7.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　巴勒斯坦，伯利恒周围的农民。照片大约拍摄于1890-1900年之间。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F44609295j00qunyai003dd200go00msg00go00ms.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　巴勒斯坦，骑着毛驴的伯利恒人。照片大约拍摄于1890-1900年之间。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F20bd3abaj00qunyai002hd200go00c6g00go00c6.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　巴勒斯坦，用牛和毛驴耕地。照片大约拍摄于1890-1900年之间。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F71800f0ej00qunyaj001wd200go00ang00go00an.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1900年，美国，麦迪逊花园广场的出租马车。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F50d3d2d9j00qunyaj002ud200go00c4g00go00c4.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　美国纽约，Mulberry 街道市场。照片大约拍摄于1900年左右。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fb6dc1f09j00qunyaj0038d200go00mlg00go00ml.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　美国马萨诸塞州，波士顿老州议会大厦。照片大约拍摄于1900年左右，手工上色。</p>\r\n<p>　　老州议会大厦坐落于美国波士顿华盛顿街和州街的路口, 兴建于1712-1713年，是波士顿最古老的建筑。</p>\r\n<p>　　1776年7月18日，在老州议会大厦的东侧阳台，独立宣言就在这里向人群公布。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fb7972002j00qunyaj001fd200go00d4g00go00d4.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1900年，美国，街头出售贝类海鲜的小贩。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fe55e81d4j00qunyak001td200go00bgg00go00bg.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1900年，美国纽约，布罗德大街。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F31098583j00qunyak001kd200go00c3g00go00c3.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　巴黎，照片大约拍摄于1900年左右。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F0eb33043j00qunyak003gd200go00ltg00go00lt.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1900年，美国，马克&middot;吐温。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fa25e34f1j00qunyal0028d200go00d9g00go00d9.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　挪威奥斯陆城街道。照片大约拍摄于1900年代初。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F036e4038j00qunyal002od200go00g8g00go00g8.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　三位挪威妇女。照片大约拍摄于1900年代初。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F3cef34b8j00qunyal001sd200go00jgg00go00jg.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　挪威，老人与孩子。照片大约拍摄于1900年代初。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Ff3a369ffj00qunyal001ed200go00cpg00go00cp.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　挪威，冰雪游客。照片大约拍摄于1900年代初。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F741592f2j00qunyam002jd200go00g4g00go00g4.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　挪威，洗衣服。照片大约拍摄于1900年代初。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F33d95d5bj00qunyam001jd200go00cxg00go00cx.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1901年，美国， \"Tashmoo\"轮船从底特律的码头出发 。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F116541dfj00qunyam0028d200go00kpg00go00kp.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1903年， 纽约熨斗大厦。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F69848191j00qunyam001ad200go00adg00go00ad.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1905年，大西洋城，海边玩耍的人们。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F64b23710j00qunyan003cd200go00u4g00go00u4.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1909年，巴黎航展。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F3e399b53j00qunyan001jd200go00bzg00go00bz.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1909年，美国佐治亚州，童工。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F165061efj00qunyan001yd200go00qtg00go00qt.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1910年，肖像。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F0f54a9fbj00qunyao0012d200go00bgg00go00bg.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1910年，年轻的夫妇与车。上色彩照。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fe40fe156j00qunyao0029d200go00idg00go00id.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　日本，寺院小径打伞的和尚。照片大约拍摄于1910年左右，手工上色。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F302ee3f8j00qunyao001sd200go00bkg00go00bk.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1910年代，美国的一个跳骚市场。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fa8dcf965j00qunyao0017d200go00kxg00go00kx.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1910年，夫妻肖像。用卢米埃尔兄弟发明的彩色片拍摄，照片被收藏于罗切斯特大学乔治&middot;伊士曼博物馆。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F6d64476bj00qunyap0015d200go00m0g00go00m0.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1910年，路易&middot;卢米埃尔在用显微镜和试管做试验。</p>\r\n<p>　　路易&middot;卢米埃尔与哥哥奥古斯塔&middot;卢米埃尔是法国的一对兄弟，发明了电影摄影机、放映机、三色彩色照片。</p>\r\n<p>　　本张照片就是用卢米埃尔兄弟发明的彩色片拍摄，照片被收藏于罗切斯特大学乔治&middot;伊士曼博物馆。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fd7592a03j00qunyap001xd200go00cug00go00cu.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1910年，美国，缅因州波特兰市。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F0d2cd88bj00qunyap0010d200go00d7g00go00d7.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1912年，英国，泰坦尼克号。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F8ef50fe7j00qunyap0027d200go00nag00go00na.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1913年，美国，三位女权主义者，左边露西&middot;伯恩斯、右边埃米琳&middot;潘克和赫斯特夫人(中)。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F00ccf055j00qunyaq002cd200go00oeg00go00oe.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1913年，孙子与祖父穿着巴伐利亚和普鲁士新旧德国军队制服。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fe64a6196j00qunyaq0026d200go00kyg00go00ky.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1915年，着埃及服装的舞者。卢米埃尔兄弟发明的彩色片拍摄，照片被收藏于罗切斯特大学乔治&middot;伊士曼博物馆。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Ff64dc85cj00qunyaq001md200go00bcg00go00bc.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1915年，美国，泛美博览会园艺宫，用卢米埃尔兄弟发明的彩色片拍摄，照片被收藏于罗切斯特大学乔治&middot;伊士曼博物馆。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F3b2fd315j00qunyar001id200go00b4g00go00b4.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1917年，法国，小飞行员。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F87e7ab31j00qunyar001md200go00b4g00go00b4.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1917年，飞机。L&eacute;on Gimpel/摄。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fff72d8b3j00qunyar0015d200go00l4g00go00l4.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1919年，巴勒斯坦中部城镇拉马拉，纺毛线。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fe9aba17dj00qunyar001fd200go00d9g00go00d9.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1919年，巴勒斯坦，收割大麦。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F78f48f5cj00qunyas001nd200go00l2g00go00l2.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1919年，巴勒斯坦中部城镇拉马拉，一个女人的绣花服装。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F326e0086j00qunyas0020d200go00l4g00go00l4.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1919年，巴勒斯坦，木匠。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2Fd30a736ej00qunyas000yd200go00d2g00go00d2.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1919年，巴勒斯坦，约旦河。</p>\r\n<p>　　<img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0614%2F5cd5a3a3j00qunyas001md200go00ksg00go00ks.jpg&amp;thumbnail=650x2147483647&amp;quality=80&amp;type=jpg\" /></p>\r\n<p>　　1919年，耶路撒冷街道拱门。手工上色。</p>\r\n<p>　　微言大义</p>\r\n<p>　　张张都是经典，张张给人的是震撼，19世纪末20世纪初世界风采尽收眼底，真实再现。</p>\r\n<p>　　感谢这些100年前的影像记录者，为人类历史的记载与传承在影像世界里做出了他们不可磨灭的贡献。</p>',NULL,1,1624071681,1624071681,NULL),
	(18,1,'雨天，手机摄影想拍就拍！',NULL,'又到了回南天，除了下雨就是阴天，潮潮的。这个时候就不能拍晴天的照片了，那么就来看看雨天的拍照技巧吧！1、雨天拍雨痕其实下雨天拍照比晴天更能显示一个人的拍摄水平。下雨天一部手机就轻松帮你提升照片逼格的秘诀在于——拍雨痕。将手机的聚焦在雨滴上，透明玻璃上','https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2F5e9dfacbj00qu92kn002ld200go00neg00go00ne.jpg&thumbnail=650x2147483647&quality=80&type=jpg',NULL,'<p>又到了回南天，除了下雨就是阴天，潮潮的。这个时候就不能拍晴天的照片了，那么就来看看雨天的拍照技巧吧！</p>\r\n<p>　　1、雨天拍雨痕</p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2F8c79f0a3j00qu92kj000wd200e4008ng00e4008n.jpg&thumbnail=650x2147483647&quality=80&type=jpg\" /></p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2F010ba984j00qu92kj001ad200e4009ig00e4009i.jpg&thumbnail=650x2147483647&quality=80&type=jpg\" /></p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2F8ad4e2e2j00qu92kk0010d200e400e2g00e400e2.jpg&thumbnail=650x2147483647&quality=80&type=jpg\" /></p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2F44a2ba6fj00qu92kk0012d200e4008ug00e4008u.jpg&thumbnail=650x2147483647&quality=80&type=jpg\" /></p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2F1ca11c8fj00qu92kk0018d200e4009hg00e4009h.jpg&thumbnail=650x2147483647&quality=80&type=jpg\" /></p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2F43ee958ej00qu92kk0019d200e4009fg00e4009f.jpg&thumbnail=650x2147483647&quality=80&type=jpg\" /></p>\r\n<p>　　其实下雨天拍照比晴天更能显示一个人的拍摄水平。下雨天一部手机就轻松帮你提升照片逼格的秘诀在于——拍雨痕。将手机的聚焦在雨滴上，透明玻璃上，会将雨天效果拍的格外惊喜。再利用P图软件做下背景虚化（选择窗外颜色鲜亮的地方拍摄），这样背景虚化后也可以得到彩色效果，照片不那么暗淡单调，显得清新淡雅。<br />2、用雨伞等道具做色彩对比</p>\r\n<p>　　用手机对准雨伞上淡淡的雨痕，在雨伞鲜艳颜色的映衬下，便能轻易体现自然而然的美感。在城市的亲们还可以利用街景霓虹灯做反衬。</p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2Fe9f685ebj00qu92kl002xd200go00bgg00go00bg.jpg&thumbnail=650x2147483647&quality=80&type=jpg\" /></p>\r\n<p>　　3、特写花朵上的残留雨滴</p>\r\n<p>　　拍摄植物上落下的雨滴最好等待雨过天晴，雨刚停后，将手机尽量接近花朵，用微距镜头拍摄。拍摄技巧如微距拍摄植物的技巧一样，只不过落上雨滴的花草更加美丽。有时雨滴上会倒映上植物的影子，非常可爱。</p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2Fab2223d3j00qu92kl001ld200go009dg00go009d.jpg&thumbnail=650x2147483647&quality=80&type=jpg\" /></p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2F73804816j00qu92kl0006d2006o006og006o006o.jpg&thumbnail=650x2147483647&quality=80&type=jpg\" /></p>\r\n<p>　　4、雨天拍朦胧人像</p>\r\n<p>　　大家可能会想，下雨天光线那么暗，怎么拍人像啊？告诉你，恰恰相反，雨天恰恰是拍出文艺美的最佳时刻。绵绵细雨的时候适合拍摄唯美的小清新人像，稍大的雨可以将匆忙赶路人的奔跑状态和神情很自然的抓拍，更加写实生动。不同的雨天拍摄，表现不同的雨中情雨中景。个中滋味，学友们只要一试就会爱上。</p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2Fb319dee7j00qu92km003ed200go00p0g00go00p0.jpg&thumbnail=650x2147483647&quality=80&type=jpg\" /></p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2F2ecf97e3j00qu92km000qd200b300gog00b300go.jpg&thumbnail=650x2147483647&quality=80&type=jpg\" /></p>\r\n<p>　　5、聚焦水中倒影别有味道</p>\r\n<p>　　下雨天用手机拍倒影是难度较高的拍摄角度。但倒影是朋友圈晒图的必备技能。首先宝宝先要找一个雨滩，最好能映衬下周围的建筑和过往的行人；其次就是等待时机，或喊友人站到雨滩旁边，或等待行人恰巧路过能倒影在雨滩内。然后宝宝站到水滩对面，面对模特，聚焦在水面，找好角度就可以啦。其次人物的pose一定要帅要个性才有拍摄意义。学友们可以参考下以下几种姿势。</p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2F5e9dfacbj00qu92kn002ld200go00neg00go00ne.jpg&thumbnail=650x2147483647&quality=80&type=jpg\" /></p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2F83ab87dfj00qu92kn002vd200dw00kug00dw00ku.jpg&thumbnail=650x2147483647&quality=80&type=jpg\" /></p>\r\n<p><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2021%2F0606%2F85248495j00qu92ko0014d200c800icg00c800ic.jpg&thumbnail=650x2147483647&quality=80&type=jpg\" /></p>\r\n<p>　　我想和你看世界</p>\r\n<p>　　中国摄影网签约摄影师作品征集</p>\r\n<p>　　1、作品类型、风格、主题不限，但必须是以一个完整的专题形式呈现，须提供主题阐述、摄影师的近期 形象照 及个人简介200字左右，其他可以提供包括个人联系方式、摄影经历、荣衔资历，重要获奖、摄影感悟等。</p>\r\n<p>　　2、个人作品集（每组15-30张，文件格式：JPG，图片宽度 大于3840像素 ，或者文件 大于5M ，不得有水印）须有每幅作品的标题或图片内容说明。</p>\r\n<p>　　3、将以上两组文件打包压缩成RAR或ZIP格式发送网站编辑部，万能邮箱： cnphotos@163.com 。</p>\r\n<p>　　4、入选作品，将在签约摄影师作品赏析、名家经典等栏目刊登， 其作品也将登记入库，作图片销售代理，优秀作品将推荐人民网、人民摄影报、澎湃新闻等媒体刊发，同时， 将有资格参与中国摄影网十佳摄影师评选 ，入编《中国摄影网》杂志期刊，颁发签约摄影师证书、入展证书。</p>',NULL,1,1624071727,1624165505,NULL),
